import React from 'react';
import './App.css';
import Main from './components/Pages/Main';
import Navbar from './components/Navbar/Navbar';
import Particles from 'react-particles-js';

const particalOpt = {
  particles: {
    number: {
      value: 130,
      density: {
        enable: true,
        value_area: 800

      },

    }
  }
}


const App = () => (
  <div>

    <Navbar />

    <div className="container">
      <Main />
    </div>
    <Particles
      params={{
        "particles": {
          "line_linked": {
            "color": "#FFFFFF"
          },
          "number": {
            "value": 150
          },
          "size": {
            "value": 5
          }
        },
        "interactivity": {
          "events": {
            "onhover": {
              "enable": true,
              "mode": "repulse"
            }
          }
        }
      }}
      style={{
        width: '100%',
        background: `#000000`
      }}
    />
    )}
}
  </div>
)

export default App;
